import './Css/feedback.css';
import React from 'react';
import Select from 'react-select';
import Aside from '../Quizz - 01/Aside/Aside';
import Main from '../Main/Main';

function Feedback() {
    const assunto = [
        {value: 'Bugs', label: 'Bugs'},
        {value: 'Como podemos melhorar', label: 'Como podemos melhorar'},
        {value: 'Elogios', label: 'Elogios'},
    ]; 
    return (
        <div className='Feedback'>
            <Aside />
            <Main>
                <div className='feedback_content'>
                    <h1>Conte-nos a sua opinião!</h1>
                    <form method='post' className='form_cont'>
                        <div className='form_name'>
                            <input type='text' placeholder='Nome...' />
                            <input type='text' placeholder='Sobrenome...' />
                        </div>{/* form_name */}
                        <div className='form_info'>
                            <input type='email' placeholder='Seu email...' />
                            <div className='container'>
                                <Select
                                    options={assunto}
                                    placeholder={'Escolha uma opção...'}
                                    styles={{
                                        control: (defaultStyles, state) => ({
                                            ...defaultStyles,
                                            borderColor: state.isFocused ? 'blue' : 'grey',
                                            border: '2px solid #6940e7',
                                            borderRadius: '20px',
                                            paddingLeft: '5px',
                                            width: '400px',
                                            margin: '10px 0',
                                            height: '38px',
                                            transition: '0.7s',
                                            cursor: 'pointer',
                                        }),
                                        placeholder: (defaultStyles) => ({
                                            ...defaultStyles,
                                            marginTop: '-11px',
                                        }),
                                        valueContainer: (defaultStyles) => ({
                                            ...defaultStyles,
                                            height: '30px',
                                        }),
                                        indicatorSeparator: (defaultStyles) => ({
                                            ...defaultStyles,
                                            height: '55%',
                                            marginTop: '7.5px',
                                        }),
                                        dropdownIndicator: (defaultStyles) => ({
                                            ...defaultStyles,
                                            marginTop: '0',
                                        }),
                                        singleValue: (defaultStyles) => ({
                                            ...defaultStyles,
                                            marginTop: '-11px',
                                        }),
                                        option: (defaultStyles) => ({
                                            ...defaultStyles,
                                            cursor: 'pointer',
                                        }),
                                        input: (defaultStyles) => ({
                                            ...defaultStyles,
                                            marginTop: '-8px',
                                        })
                                    }}
                                />
                            </div>    
                            <textarea placeholder='Menssagem...'></textarea>
                        </div>{/* form_info */}
                        <div className='form_gender'>
                            <p>Como você se identifica?</p>
                            <div className='form_gender_inputCont'>
                                <input id='masculino' type='radio' name='genero' />
                                <label htmlFor='masculino'></label>
                                <span>Masculino</span>
                            </div>{/* form_gender_inputCont */}
                            <div className='form_gender_inputCont'>
                                <input id='feminino' type='radio' name='genero' />
                                <label htmlFor='feminino'></label>
                                <span>Feminino</span>
                            </div>{/* form_gender_inputCont */}
                            <div className='form_gender_inputCont'>
                                <input id='nenhum' type='radio' name='genero' />
                                <label htmlFor='nenhum'></label>
                                <span>Nenhum</span>
                            </div>{/* form_gender_inputCont */}
                        </div>{/* form_gender */}
                        <div className="form_birthday">
                            <p>Quando você nasceu?</p>
                            <div className='form_birthday_inputCont'>
                            <Select
                                id='day'
                                placeholder={'Dia...'}
                                styles={{
                                    control: (baseStyles, state) => ({
                                        ...baseStyles,
                                        borderColor: state.isFocused ? 'blue' : 'grey',
                                        border: '2px solid #6940e7',
                                        borderRadius: '20px',
                                        paddingLeft: '7px',
                                        width: '20%',
                                        marginTop: '10px',
                                        minHeight: '0',
                                        transition: '0.7s',
                                        cursor: 'pointer',
                                    }),
                                }}
                            />  
                            </div>{/* form_birthday_inputCont */}
                            <div className='form_birthday_inputCont'>
                            <Select
                                placeholder={'Mês...'}
                                id='month'
                                styles={{
                                    control: (baseStyles, state) => ({
                                        ...baseStyles,
                                        borderColor: state.isFocused ? 'blue' : 'grey',
                                        border: '2px solid #6940e7',
                                        borderRadius: '20px',
                                        paddingLeft: '7px',
                                        width: '20%',
                                        marginTop: '10px',
                                        minHeight: '0',
                                        transition: '0.7s',
                                        cursor: 'pointer',
                                    }),
                                }}
                            />  
                            </div>{/* form_birthday_inputCont */}
                            <div className='form_birthday_inputCont'>
                            <Select
                                placeholder={'Ano...'}
                                id='year'
                                styles={{
                                    control: (baseStyles, state) => ({
                                        ...baseStyles,
                                        borderColor: state.isFocused ? 'blue' : 'grey',
                                        border: '2px solid #6940e7',
                                        borderRadius: '20px',
                                        paddingLeft: '7px',
                                        width: '20%',
                                        minHeight: '0',
                                        transition: '0.7s',
                                        marginTop: '10px',
                                        cursor: 'pointer',
                                    }),
                                }}
                            />  
                            </div>{/* form_birthday_inputCont */}
                        </div>{/* form_birthday */}
                        <div className='button_submit_cont'>
                            <input type='submit' name='action' value={'Enviar'} />
                        </div>{/* button_submit_cont */}
                    </form>{/* form_cont */}
                </div>{/* feedback_content */}
            </Main>
            <Aside />
        </div>
    )
}

export default Feedback;
